    return (
      <section class="slides">
        <ul class="slides__items">
          <li class="slides__list">
            <img class="slides__img" src={hero} alt="hero" />
            <p class="slides__text">
              <a href="" class="slides__text--link">
                shop now
              </a>
            </p>
            <p class="slides__bottomtext">
              flash sale<span class="slides__textspan">explore your taste</span>{" "}
            </p>
          </li>
        </ul>
      </section>
    );
  }
}
